import React from 'react'

function RutinaDetail(ejercicios) {

  return ( <div>
    {ejercicios.map((ejercicio, index) => (
      <div key={index}>
        <h2>{ejercicio}</h2>
      </div>
    ))}
  </div>
  )
}

export default RutinaDetail
